ermulcet sensum voluptate. Quod eo liquidius faciet, si perspexerit rerum inter eas verborumne sit controversia. In qua si nihil est praeter rationem, sit in una virtute finis bonorum;</span></p>"},"Layers":[],"Text":"Two"},"shape3":{"Props":{"Description":"<h4><strong>Utrum igitur tibi litteram videor an totas paginas commovere?</strong></h4><p>Tu enim ista lenius, hic Stoicorum more nos vexat.&nbsp;<a style=\"color: rgb(74, 144, 226);\" href=\"http://loripsum.net/\" target=\"_blank\">Sed quae tandem ista ratio est?</a>&nbsp;Vide, ne etiam menses! nisi forte eum dicis, qui, simul atque arripuit, interficit. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Quae in controversiam veniunt, de iis, si placet, disseramus.&nbsp;<a style=\"color: rgb(74, 144, 226);\" href=\"http://loripsum.net/\" target=\"_blank\">Quorum altera prosunt, nocent altera.</a>&nbsp;<strong>Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse;</strong></p>"},"Layers":[],"Text":"Three"},"shape4":{"Props":{"Description":"<p>Sic enim censent, oportunitatis esse beate vivere. Aliter homines, aliter philosophos loqui putas oportere?&nbsp;<strong>Quorum altera prosunt, nocent altera.</strong>&nbsp;<em>Quae contraria sunt his, malane?</em>&nbsp;Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus;</p><p><br></p><p>At, illa, ut vobis placet, partem quandam tuetur, reliquam deserit. Si longus, levis.</p><p><br></p><ul><li>Itaque eos id agere, ut a se dolores, morbos, debilitates repellant.</li><li>Idem etiam dolorem saepe perpetiuntur, ne, si id non faciant, incidant in maiorem.</li><li>Istic sum, inquit.</li><li>Nec vero pietas adversus deos nec quanta iis gratia debeatur sine explicatione naturae intellegi potest.</li><li>Dici enim nihil potest verius.</li></ul><p><br></p><p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Quo igitur, inquit, modo? Quis enim confidit semper sibi illud stabile et firmum permansurum, quod fragile et caducum sit?&nbsp;<a style=\"color: rgb(74, 144, 226);\" href=\"http://loripsum.net/\" target=\"_blank\">Ut optime, secundum naturam affectum esse possit.</a>&nbsp;Traditur, inquit, ab Epicuro ratio neglegendi doloris. Duo Reges: constructio interrete.</p>"},"Layers":[],"Text":"Four"}},"pages":[{"Name":"Page-1","Id":0,"FileName":"HtmlFormsDemo1.html"}],"currentPage":{"Name":"Page-1","Id":0,"FileName":"HtmlFormsDemo1.html"},"layers":[],"enableProps":true,"twoFingersTouch":false,"enableLinks":true,"enablePages":true,"enablePageLookup":false,"enableZoomCtrl":false,"enableZoomShift":false,"enableSearch":false,"enableMultiPageSearch":false,"enableCode":false,"enableSidebar":true,"enableTooltips":true,"enableSelection":true,"enableLayers":false,"enableFollowHyperlinks":true,"openHyperlinksInNewWindow":true,"rightSidebar":false,"alwaysHideSidebar":false,"enableSidbarTitle":false,"enableSidebarHtml":false,"enableTooltipHtml":false,"enableD3":false,"tooltipPlacement":"","popoverPlacement":"auto right","enablePopovers":true,"enablePopoverHtml":true,"tooltipTrigger":"","tooltipTimeout":false,"tooltipTimeoutShow":"","tooltipTimeoutHide":"","popoverTrigger":"hover","popoverTimeout":true,"popoverOutsideClick":false,"popoverTimeoutShow":"","popoverTimeoutHide":"2000"}
